import Logo from "../utilities/image/Logo.svg";

import "animate.css"

import Navbar from "react-bootstrap/Navbar";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import "../utilities/css/home.css";

export default function Home() {
  return (
    <div className="home">
      <Navbar className="animate__animated animate__fadeIn animate__delay-3s" fixed="top" bg="dark" variant="dark">
        <Container className="nav--home" >
          <Navbar.Brand href="#home"><img src={Logo}></img></Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <div class="logoPos">
        <img class="imageSpin" src={Logo}></img>
      </div>
    </div>
  );
}
